        /// <summary>
        /// 获取交易对列表
        /// </summary>
        /// <returns></returns>
        public static IEnumerable<FtxMarket> GetSymbolFutureList()
        {
            string url = FTXFUTURESUSDTMARKET_DEFAULT_HOST + symbols;
            List<FtxMarket> results = null;
            while (true)
            {
                try
                {
                    var list = ApiHelper.GetExtbinance(url);
                    results = ((object)list.result).ToString().ToList<FtxMarket>();
                }
                catch (Exception e)
                {
                    Console.WriteLine("获取ftx交易对数据异常，异常信息：" + e.ToString());
                    Console.WriteLine("再次执行");
                }
                if (results != null)
                {
                    break;
                }
            }
            return results;
        }

        /// <summary>
        /// 获取交易对
        /// </summary>
        /// //TYPE: USD/USDT
        /// <returns></returns>
        public static string GetSymbollist(string type)
        {
            List<FtxMarket> list = null;
            if (type == "Part")
            {
                list = GetSymbolFutureList().Where(p => p.VolumeUsd24H>50000000&&p.Type== "future").ToList();
            }
            else
            {
                list = symbolstring.ToList<FtxMarket>().Where(p => p.Name.Contains("-PERP")&& p.VolumeUsd24H > 50000000 && p.Type == "future").ToList();
            }
            string result = "";
            if (list.Count() != 0)
            {
                result = string.Join(",", list.Select(p => p.Name).ToList());
            }
            else
            {
                result = "BBTC,LTC,BCH,ETH,EOS,BSV,ETC,LINK,DOT,XRP,UNI,DOGE";
            }
            return result;

        }


