        /// <summary>
        /// 获取持仓和下期费率
        /// </summary>
        /// <param name="symbol">The symbol to get the data for</param>
        /// <param name="startTime">Start time to get funding rate history</param>
        /// <param name="endTime">End time to get funding rate history</param>
        /// <param name="limit">Max number of results</param>
        /// <param name="ct">Cancellation token</param>
        /// <returns>The funding rate history for the provided symbol</returns>
        public FtxFundingRateOpenInstert GetNextFundingRatesOpenInstertAsync(string symbol)
        {
          

            string location = $"/futures/{symbol}/stats";

            string url = FTXFUTURESUSDTMARKET_DEFAULT_HOST + location;

            FtxFundingRateOpenInstert results = null;

            while (true)
            {
                try
                {
                    var list = ApiHelper.GetExtx(url);
                    results = ((object)list.result).ToString().ToObject<FtxFundingRateOpenInstert>();
                }
                catch (Exception e)
                {
                    Console.WriteLine("获取 FTX 下期 费率和持仓信息数据异常，异常信息：" + e.ToString());
                    Console.WriteLine("再次执行");
                }
                if (results != null)
                {
                    break;
                }

            }
            return results;
        }


        /// <summary>
        /// 获取费率
        /// </summary>
        public List<FtxFundingRate> GetFundingRates(string symbol)
        {
            //long timestamp = 0;
            //if (times != "")
            //{
            //    timestamp = Convert.ToInt64(times);
            //}
            //else
            //{
            //    timestamp = 1614009600000;
            //}

          
            long start_time = 0;
            long end_time = 0;


            start_time = GZipDecompresser.GetUnixTimestamp(DateTime.Now);

            end_time = GZipDecompresser.GetUnixTimestamp(DateTime.Now);

      
            string location = $"/funding_rates={symbol}&&start_time={start_time}&&end_time={end_time}";
         



            string url = FTXFUTURESUSDTMARKET_DEFAULT_HOST  + location;

            List<FtxFundingRate> results = null;

            while (true)
