            }
            return results;
        }


        /// <summary>
        /// 根据使用symbol获取费率和持仓
        /// </summary>
        public void GetFundingRateAndOpenInterest()
        {
            List<FundRate> FundRatelist = new List<FundRate>();
            List<OpenInterest> OpenInterestlist = new List<OpenInterest>();
            string typemessage = "U本位持仓和费率";

            var symbollist = GetSymbollistobject("ALL");
            if (symbollist !=null)
                foreach (var item in symbollist)
                {

                    List<FtxFundingRateOpenInstert> openinserthistorylist = new List<FtxFundingRateOpenInstert>();

                    openinserthistorylist.Add(GetNextFundingRatesOpenInstertAsync(item.Name));
                    
                    foreach (var funs in openinserthistorylist)
                    {
                        //if (item.Name.Contains("PERP"))
                        //{

                        //}
                        //else
                        //{ 
                        
                        //}
                        //if (item.Name.Contains("BTC"))
                        //{ 
                        
                        //}


                        if (funs.nextFundingRate != 0)
                        {
                            FundRate i = new FundRate();
                            i.market = item.Name;
                            i.exchange = CommandEnum.RedisKey.ftx;
                            i.FundingRate = funs.nextFundingRate.ToString();
                            i.symbol = item.Name;
                            i.times = DateTime.Now.ToString();
                            i.NextFundingRate = i.NextFundingRate;
                            FundRatelist.Add(i);
                        }

                        OpenInterest o = new OpenInterest();
                        o.market = item.Name;
                        o.exchange = CommandEnum.RedisKey.ftx;
                        o.SumOpenInterest = Convert.ToDecimal(funs.openInterest);
                        o.symbol = item.Name;
                        o.times = DateTime.Now.ToString();
                        o.SumOpenInterestValue = Convert.ToDecimal(funs.openInterest)* item.Price;
                        o.type = CommandEnum.RedisKey.coin;
                        o.desc = "币";
                        o.price = item.Price;
                        o.volumeUsd24h = item.VolumeUsd24H;
                        o.coin = funs.openInterest;

                        if (item.Name.Contains("PERP"))
                        {
                            o.kind = CommandEnum.RedisKey.PERP;
                        }
                        else
                        {
                            o.kind = CommandEnum.RedisKey.DELIVERY;
                        }

                        OpenInterestlist.Add(o);
                    }


                }



            RedisHelper.Pushdata(FundRatelist.ToJson(), "11", CommandEnum.RedisKey.FundingRate + DateTime.Now.ToString("yyyy-MM-dd"));
            RedisHelper.Pushdata(OpenInterestlist.ToJson(), "11", CommandEnum.RedisKey.OpenInterest + DateTime.Now.ToString("yyyy-MM-dd"));

            Console.WriteLine("FTX 结束持仓和费率数据获取：" + CommandEnum.RedisKey.ftx+DateTime.Now.ToString()+ typemessage);

        }



